import Todo_List from './Todo_list';
import React, {useState} from 'react'
import Todo_list from './Todo_list';

function App() {

 const om = () => {
   return  <div>{<Todo_list/>}</div>
 }

  return (   
    <div className="App">
       <div> 
         <h1>Person Menager</h1>
         <h5>This is my task</h5>
         <h4>Toggle Person</h4> 
         <button onClick = {om}>Task List</button>
        </div>
    </div>
  );
}

export default App;
